/*Table structure for table `people` */

DROP TABLE IF EXISTS `people`;

CREATE TABLE `people` (
  `person_id` bigint(20) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Table for storing person data',
  `person_type` varchar(4) DEFAULT NULL,
  `person_first_name` varchar(25) DEFAULT NULL,
  `person_last_name` varchar(25) DEFAULT NULL,
  `person_photo` varchar(255) DEFAULT NULL,
  `person_national_id_no` varchar(13) NOT NULL,
  `person_gender` char(1) DEFAULT NULL,
  `person_birth_date` date DEFAULT NULL,
  `person_birth_place` varchar(45) DEFAULT NULL,
  `person_job` varchar(45) DEFAULT NULL,
  `person_life_address` varchar(200) DEFAULT NULL,
  `person_life_municipality` varchar(45) DEFAULT NULL,
