  `person_life_zip` varchar(45) DEFAULT NULL,
  `person_life_region` varchar(45) DEFAULT NULL,
  `person_telephone_number` varchar(12) DEFAULT NULL,
  `person_fax_number` varchar(12) CHARACTER SET dec8 DEFAULT NULL,
  `person_email_address` varchar(255) NOT NULL,
  `person_postal_address` varchar(200) DEFAULT NULL,
  `person_post_municipality` varchar(45) DEFAULT NULL,
  `person_post_city` varchar(45) DEFAULT NULL,
  `person_post_region` varchar(45) DEFAULT NULL,
  `person_created_by` varchar(16) DEFAULT NULL,
  `person_created_date` datetime DEFAULT NULL,
  `person_modified_by` varchar(16) DEFAULT NULL,
  `person_modified_date` datetime DEFAULT NULL,
  `person_is_active_flag` varchar(45) DEFAULT NULL,
  PRIMARY KEY (`person_id`),
  UNIQUE KEY `person_id_UNIQUE` (`person_id`),
  UNIQUE KEY `person_national_id_no_UNIQUE` (`person_national_id_no`),
  UNIQUE KEY `person_email_address_UNIQUE` (`person_email_address`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

